INSERT INTO `job_description` VALUES ('JD13439114','<p>Selection Process: </p><p>1) Technical Round<br/>2) HR Round</p><p></p><p>Note:</p><ul><li>Candidates are required to submit their applications through the link provided below. </li><li>Please share the list of candidates who have completed their applications. I will follow up with the client to get updates regarding their status. </li><li>Please note that the client will send interview feedback directly to the candidates via email on the same day of the interview.</li></ul><p>Apply using the link below:<br/>https://lnkd.in/gsc7MaXS<br/></p><p>Interview Date: September 5th, 9:30AM.<br/><br/>Venue: AutoRABIT, 5th Floor, iSprout, My Home Twitza, Hitech City Main Road, Gachibowli, Hyderabad. <br/> </p>','AutoRABIT is the leader in DevSecOps for SaaS platforms such as Salesforce. Its unique metadata-aware capability makes Release Management, Version Control, and Backup & Recovery complete, reliable, and effective. AutoRABIT’s highly scalable framework covers the entire DevSecOps cycle, which makes it the favourite platform for companies, especially large ones who require enterprise strength and robustness in their deployment environment. AutoRABIT increases the productivity and confidence of developers which makes it a critical tool for development teams, especially large ones with complex applications. AutoRABIT has institutional funding and is well positioned for growth. Headquartered in the CA, USA and with customers worldwide, AutoRABIT is a place for bringing your creativity to the most demanding SaaS marketplace.','Allowed','2025-09-01 15:45:18.394487','Allowed','1 Year','https://img.smitio.com/Image/Resize/431ecd5e-28af-47c2-be8d-2c139c2525ce/200/200/image','AutoRabit Software','2025-09-01 15:40:40.151067',0,'Pending Scheduling','Any','2025-09-05',_binary '\0','JD approved by Abhijin Jain, on 2025-09-0115:45:18.394486500','approved','Hyderabad',_binary '','MGR11300252',0,0,7,0,50,0,'EXE44413476','any','Associate Automation Engineer','<p><em><strong>Job Role</strong></em><br/><em>We are looking for a passionate and detail-oriented</em> <em>Associate Automation Engineer</em> <em>to join our QA team. This is an excellent opportunity for a recent graduate or fresher with up to 1 year of experience to grow their career in software testing and automation. You will be involved in testing scalable web applications, writing automated scripts, and contributing to quality improvements across the product.</em><br/><br/><em><strong>Responsibilities</strong></em></p><ul><li><em>Participate in the testing of web-based applications to ensure high performance, usability, and stability.</em></li><li><em>Create, execute, and maintain test cases — both manual and automated.</em></li><li><em>Write and manage test scripts using</em> <em>Selenium</em> <em>or</em> <em>Playwright</em> <em>with</em> <em>Java.</em></li><li><em>Collaborate with developers, product owners, and other QA team members to understand requirements and test scenarios.</em></li><li><em>Perform regression testing and report issues with clarity and accuracy.</em></li><li><em>Use tools like</em> <em>Git</em> <em>for version control and</em> <em>JIRA</em> <em>or equivalent for bug tracking.</em></li><li><em>Support build verification and release readiness checks.</em></li><li><em>Learn and apply testing best practices and contribute to QA process improvements.</em></li><li><em>Responsibility to adhere to set internal controls.</em> </li></ul>','','6 LPA','automation_testing,manual_testing,selenium,java','Information Technology,Computer Science,Computer Applications,Software Engineering,Artificial Intelligence and Data Science,Electronics and Communication Engineering,Computer Science and Engineering','2025-09-01 15:49:22.983542','https://www.autorabit.com/','EXE44413476','STACK004'),('JD38166740','<p><strong> 1sT Round </strong>– Telephonic Interview</p><p>Initial screening calls to evaluate communication skills, academic background, and overall interest</p><p>in the role.</p><p><strong>2nd Round</strong> – Virtual Screening</p><p>Conducted online to assess conceptual understanding, logical reasoning, and suitability for the</p><p>position.</p><p><strong>3rd Round</strong> – Written Assessment (Offline)</p><p>Aptitude Test</p><p>Coding Assessment</p><p>Logical Thinking</p><p> <strong>4th Round</strong> – Technical Interview (Offline)</p><p>Detailed technical discussion with our technical team.</p><p>Note: Candidates are required to carry their personal laptops for this round.</p><p><strong>5th Round </strong>– Managerial Interview (Offline)</p><p>Final interaction to assess soft skills, cultural fit, and long-term vision alignment with the company.</p>','Saina Cloud, a dynamic force since 2019, pioneer in Dynamics 365, Power Platform, excelling in development, integration, and managed services with technological prowess.','Not Allowed','2025-09-01 16:28:53.147532','Not Allowed',' 2 Years of Bond, Original Documents needs to be submitted\n If Bond Broke - No Relieving letter will be Provided ','https://media.licdn.com/dms/image/v2/D560BAQFKmCOgm8CZFg/company-logo_200_200/B56ZeYVdKSHEAI-/0/1750607451721?e=2147483647&v=beta&t=XdA1Zr6FTLIqZ2hlgErpnpS1Mq3lbcpQZ1JO-L_LT0o','Saina Cloud Software Solutions Private Limited','2025-09-01 16:01:26.808074',0,'Pending Scheduling','Any','2025-09-02',_binary '\0','JD approved by Abhijin Jain, on 2025-09-0116:28:53.147531600','approved','Bengaluru',_binary '','MGR11300252',2025,2023,7,0,25,60,'EXE13174094','B.E,B.Tech,B.Sc,BCA,MCA','Junior Developer ','<p>We are looking for passionate and curious individuals who are interested in building a career in software</p><p>development using Microsoft Technologies, especially Power Platform and Dynamics 365 Finance &amp;</p><p>Operations (F&amp;O). The ideal candidate should have a knowledge of programming and logical thinking.</p>','3 monthly stipend of ₹15,000 /  CTC of ₹3 LPA.','3 LPA','core java,rest api,react.js,javascript,mysql,git,github,advanced java,css3,html5','Computer Science and Engineering,Information Technology,Electrical and Electronics','2025-09-01 16:28:53.147531','https://sainacloud.com/','EXE13174094','STACK001'),('JD38605581','<p>Round 1 – Technical + Assignment Round (Virtual)</p><p>Round 2-Manager Round (Virtual)</p><p>Round 3-HR Round (Face-to-Face)</p>','At Angodigital Technologies, we specialize in delivering fast, flexible, and future-ready digital solutions. From frontend and backend development to custom ','Not Allowed',NULL,'Not Allowed','NO','https://media.licdn.com/dms/image/v2/D560BAQFKpsy75oUTuw/company-logo_200_200/B56ZVvTlqKHQAM-/0/1741329161337/angodigitaltechnologiesprivatelimited_logo?e=2147483647&v=beta&t=KKjtA8aezu2PP22NIRl-13PY3Dj2LN34J7uGXhDXqmc','Angodigital Technologies Private Limited','2025-09-03 17:13:36.337262',0,'Pending Scheduling','Any','2025-09-08',_binary '\0',NULL,'pending','Bangalore',_binary '\0','MGR11300252',2025,2024,7,0,10,60,'EXE13174094','B.Tech,B.E','Frontend Developer Intern','<p>This is an internship role for a Frontend Developer. The Frontend Developer will be responsible for developing, testing, and maintaining web applications, ensuring responsive web design, and collaborating with back-end developers. The role involves regular coding, debugging, and optimizing performance of frontend components. This is a hybrid role located in Bengaluru. </p>',' Stipend 5-6K / Full time 2.6 to 3.2 CTC ',' 2.6 to 3.2 CTC','front-end_development_&_responsive_web_design,web_&_software_development,back-end_web_development,react_native_&_app_development,html,javascript,react,object-oriented_web_applications_(javascript,react,problem-solving_&_analytical_skills,independent_&_team_collaboration,computer_science_/_related_field.','Computer Science and Engineering,Information Technology','2025-09-03 17:13:36.352968','https://www.angodigitaltech.com/','EXE13174094',NULL),('JD43751498','<p>Round 1 – Technical + Assignment Round (